import { Link, Outlet } from "react-router-dom";
import "./AdminHome.css";
import logo from "./Images/Screenshot (55).png"; // Import the logo image

export default function AdminHome() {
    return (
        <div>
            <nav className="navbar navbar-expand-sm bg-dark mb-3">
                <div className="container-fluid">
                    
                    <ul className="navbar-nav">
                    <li className="navbar-brand">
    <Link to="/">
        <img src={logo} alt="Logo" style={{ width: '100px', height: 'auto' }} />
    </Link>
</li>

                        <li className="nav-item">
                            <Link to="/approveSeller" className="nav-link px-3">Approve Seller</Link> {/* Corrected className */}
                        </li>
                        <li className="nav-item">
                            <Link to="/manageUsers" className="nav-link px-3">Manage Users</Link> {/* Corrected className */}
                        </li>
                        <li className="nav-item">
                            <Link to="/viewFeedback" className="nav-link px-3">View Feedback</Link> {/* Corrected className */}
                        </li>
                        <li className="nav-item">
                            <Link to="/addCategory" className="nav-link px-3">Add Category</Link> {/* Corrected className */}
                        </li>
                        <li className="nav-item">
                            <Link to="/addProduct" className="nav-link px-3">Add Product</Link> {/* Corrected className */}
                        </li>
                        <li className="nav-item">
                            <Link to="/logout" className="nav-link px-3">Logout</Link> {/* Corrected className */}
                        </li>
                    </ul>
                </div>
            </nav>

            <h1>Admin Home</h1>
            <Outlet />
        </div>
    );
}
